con:config.script:
def setCookie = testRunner.testCase.testSteps['Login'].testRequest.response.responseHeaders['Set-Cookie']

def re = /^[^=]+=([^;]+)/
def cookie = ""

setCookie.each{ cookiePart ->
def match = (cookiePart =~ re)[0]
if (!match[1].equals('deleted')){
cookie <<= match[0]
cookie <<= '; '
}
}
return cookie.toString()
